    private void printRoutes(MMAS_MEM_MADTSP mmas_mem_madtsp) {
        for (IterationStatistic iter : mmas_mem_madtsp.getIterationStatistics()) {
            if ((iter.getIteration() - 1) == 0 || (iter.getIteration() - 1) % 10 == 0 || iter.getIteration() == mmas_mem_madtsp.getIterationStatistics().size())
                System.out.println(
                        "assertThat(getTourString(mmas_mem_madtsp.getIterationStatistics().get(" + ((int) iter.getIteration() - 1) +
                                ").getMvsbTour())).isEqualTo(\"" +
                                getTourString(mmas_mem_madtsp.getIterationStatistics().get((int) iter.getIteration() - 1).getMvsbTour()) +
                                "\");"
                );
        }
    }

    private void printTest(MMAS_MEM_MADTSP mmas_mem_madtsp) {
        for (IterationStatistic iter : mmas_mem_madtsp.getIterationStatistics()) {
            if (iter.getIteration() % 10 == 0 || (iter.getIteration() - 1) % 10 == 0 || (iter.getIteration() - 5) % 10 == 0)
            System.out.println(
                    "checkValues(mmas_mem_madtsp, " +
                            ((int) iter.getIteration()) + ", " +
                            iter.getIterationMean() + ", " +
                            iter.getIterationSd() + ", " +
                            iter.getBranchFactor() + ", " +
                            iter.getDiversity() + ", " +
                            iter.getBestSoFar() + ");"
            );
        }
    }

    private void checkValues(MMAS_MEM_MADTSP mmas_mem_madtsp, int iteration, double mean, double sd, double branchFactor, double div, double bsf) {
        assertThat(mmas_mem_madtsp.getIterationStatistics().get(iteration - 1).getIteration()).isEqualTo(iteration);
        assertThat(round(mmas_mem_madtsp.getIterationStatistics().get(iteration - 1).getIterationMean())).isEqualTo(round(mean));
        assertThat(round(mmas_mem_madtsp.getIterationStatistics().get(iteration - 1).getIterationSd())).isEqualTo(round(sd));
        assertThat(round(mmas_mem_madtsp.getIterationStatistics().get(iteration - 1).getBranchFactor())).isEqualTo(round(branchFactor));
        assertThat(round(mmas_mem_madtsp.getIterationStatistics().get(iteration - 1).getDiversity())).isEqualTo(round(div));
        assertThat(round(mmas_mem_madtsp.getIterationStatistics().get(iteration - 1).getBestSoFar())).isEqualTo(round(bsf));
    }

    private String getTourString(MMAS_MEM_MADTSP mmas_mem_madtsp) {
        StringBuilder tour = new StringBuilder("[");
        for (Vertex vertex : mmas_mem_madtsp.getGlobalStatistics().getBestRoute()) {
            tour.append(vertex.getId()).append(", ");
        }
        tour.delete(tour.length() - 2, tour.length()).append("]");
        return tour.toString();
    }

    private String getTourString(int[] tourAnt) {
        StringBuilder tour = new StringBuilder("[");
        for (int vertex : tourAnt) {
            tour.append(vertex).append(", ");
        }
        tour.delete(tour.length() - 2, tour.length()).append("]");
        return tour.toString();
    }

    private double round(double value) {
        return Double.valueOf(String.format(Locale.US, "%.2f", value));
    }
